import Link from "next/link"
import { verticalContainer } from "../styles/pages/Home"

const Home = () => {
  return (
    <verticalContainer>
      <h1>Pokedex - Bea</h1>
      <Link href="/pokedex">
        <a>Navigate to Pokedex</a>
      </Link>
    </verticalContainer>
  )
}

export default Home
